import { StyleSheet } from "react-native";

export default StyleSheet.create({
  container: {
    height: 50,
    backgroundColor: "#222222",
    justifyContent: "flex-start",
    alignItems: "flex-start",
    justifyContent: "center",
  },
  text: {
    fontSize: 30,
  },
  image: {
    height: 50,
  },
  webifyContainer: {
    marginLeft: 100,
    flexDirection: "row",
  },
});
